    padding: 5rem;
`

const Contacts= ()=>{
    return(
        <MyContacts>
            <h1>Name    : PRANAV P</h1> 
            <h5>Roll No : B201076M</h5>
            <h5>Phone   : 9847951119</h5>

        </MyContacts>
    )
}
export default Contacts
